/* eslint-disable react/jsx-props-no-spreading */
import React from 'react';
import propTypes from 'prop-types';
import Page from '../components/Page';

export default function MyApp({ Component, pageProps }) {
  <Page>
    <Component {...pageProps} />
  </Page>;
}

MyApp.propTypes = {};
